    'Warning: Enabling the "share customers" and "share orders" options is not recommended. Once activated and orders are created, you will not be able to disable these options. If you need these options, we recommend using several categories rather than several shops.' => 'সাবধানবাণী: "শেয়ার গ্রাহক" এবং "শেয়ার অর্ডার" বিকল্প সক্ষম করা বাঞ্ছনীয় নয়।একবার সক্রিয় এবং অর্ডার তৈরি করা হোলে,আপনি এই বিকল্প নিষ্ক্রিয় করতে পারবেন না। যদি আপনার এই অপশন প্রয়োজন হয়,আমরা বিভিন্ন দোকানের বদলে বরং বিভিন্ন ক্যাটাগরি ব্যবহারের সুপারিশ করি।',
