    'WARNING: This feature may not be compatible with your theme, or with some of your modules. In particular, PNG mode is not compatible with the Watermark module. If you encounter any issues, turn it off by selecting "Use JPEG".' => 'সতর্কবাণী: এই বৈশিষ্ট্যটি আপনার থিমের সঙ্গে, অথবা আপনার মডিউলের কিছু অংশের সঙ্গে সামঞ্জস্যপূর্ণ  নয়।বিশেষ করে, PNG মোড জলছাপ মডিউলের সাথে সামঞ্জস্যপূর্ণ নয়।আপনি যদি কোন সমস্যার সম্মুখিন হন তাহলে "Use JPEG" নির্বাচন করে তা বন্ধ করুন.',
    'Ranges from 0 (worst quality, smallest file) to 100 (best quality, biggest file).' => '০ থেকে (খুব খারাপ মান,খুব ছোট ফাইল)১০০(সেরা মান,সবচেয়ে বড় ফাইল) ',
    'This should be set to yes unless you successfully moved images in "Images" page under the "Preferences" menu.' => '"Preferences" মেনুর অধিনে  "Images"পেইজে ইমেজ সফলভাবে না সরানো পর্যন্ত এটি  হ্যাঁ সেট করা উচিত।',
    'This type will be used for Supplier images.' => 'এই ধরনটি সরবরাহকদের ইমেজ হিসাবে প্রয়োগ করা হবে.',
    'This type will be used for Store images.' => 'এই ধরনটি দোকানের ইমেজ হিসাবে প্রয়োগ করা হবে',
    'Will appear on email headers. If undefined, the header logo will be used.' => 'ইমেইল হেডারে প্রদর্শিত হবে।যদি অনির্ধারিত থাকে তাহলে হেডার লোগো ব্যবহার করা হবে। ',
    'You must select a shop from the above list if you wish to choose a theme.' => 'আপনি যদি একটি থিম চয়ন করতে চান, তাহলে আপনি উপরের তালিকা থেকে একটি দোকান নির্বাচন করতে হবে।',
  ),
  'AdminDesignNotification' => 
  array (
    'You can choose to keep your images stored in the previous system. There\'s nothing wrong with that.' => 'আপনি আপনার ইমেজ পূর্ববর্তী সিস্টেমের মধ্যে সংরক্ষিত রাখা বেছে নিতে পারেন. কোনো সমস্যা নেই.',
    'You can also decide to move your images to the new storage system. In this case, click on the "Move images" button below. Please be patient. This can take several minutes.' => 'আপনি নতুন স্টোরেজ সিস্টেমের আপনার ইমেজ সরানো সিদ্ধান্ত নিতে পারেন।এই ক্ষেত্রে, নীচের "সরান ছবিদয়া করে ধৈর্য ধরুন. এটি কয়েক মিনিট সময় নিতে পারে." বাটনে ক্লিক করুন.',
    'After moving all of your product images, set the "Use the legacy image filesystem" option above to "No" for best performance.' => 'আপনার সমস্ত পণ্য ইমেজ  সরানোর পরে,"লিগ্যাসি ইমেজ ফাইল সিস্টেম ব্যবহার করুন" এ সর্বোত্তম কর্ম সঞ্চালনের জন্য  না সেট করুন ',
    'If you want to order/move the following data, please select a shop from the shop list.' => ' আপনি নিম্নলিখিত তথ্য অর্ডার / স্থানান্তর করতে চাইলে, দোকান তালিকা থেকে একটি দোকান নির্বাচন করুন.',
    'No items found' => 'কোন আইটেম পাওয়া যায় নি',
    'Only part of the images have been regenerated. The server timed out before finishing.' => 'ইমেজ এর কিছু অংশ মাত্র পুনরায় গঠন করা হয়েছে। সমাপ্তির আগেই সার্ভার সময় শেষ হয়েছে। ',
    'Server timed out. The watermark may not have been applied to all images.' => 'সার্ভারের সময় শেষ হয়েছে।জলছাপ সমস্ত ইমেজ প্রয়োগ করা নাও হতে পারে.',
    'Error: Your server configuration is not compatible with the new image system. No images were moved.' => 'ত্রুটিঃ আপনার সার্ভার কনফিগারেশন নতুন চিত্র সিস্টেমের সাথে সামঞ্জস্যপূর্ণ নয়। কোন ইমেজ স্থানান্তর করা হয় নি। ',
    'Not all images have been moved. The server timed out before finishing. Click on "Move images" again to resume the moving process.' => 'সকল ছবি পাঠানো হয়নি।সমাপ্তি আগে  সার্ভার সময় শেষ হয়েছে।',
    'After modification, do not forget to regenerate thumbnails' => 'পরিবর্তন করার পরে, থাম্বনেল পুনরায় নির্মাণ করতে ভুলবেন না',
